css:
.nuclide-ui-fb-avatar {
  background-color: #27292c;
  display: inline-block;
  vertical-align: top;
  overflow: hidden;
}
.nuclide-ui-fb-avatar-image {
  background-repeat: no-repeat;
  background-size: cover;
  height: 100%;
  width: 100%;
}
.nuclide-ui-fb-avatar-missing:after {
  content: '\1F464';
  display: inline-block;
  margin-left: 2px;
  text-align: center;
}
.nuclide-ui-fb-avatar-loading .loading {
  margin: 2px auto auto 2px;
}
